    constructor(audioContext) {
        this.ctx = audioContext;
        this.activeNodes = [];
        this.isPlaying = false;
        this.currentTheme = null;
        this.tempo = 120;
    }

    stop() {
        this.activeNodes.forEach(node => {
            try {
                node.stop();
                node.disconnect();
            } catch (e) { }
        });
        this.activeNodes = [];
        this.isPlaying = false;
        if (this.timeoutId) clearTimeout(this.timeoutId);
    }

    reset() {
        this.stop();
    }

